import React, { useEffect, useState } from "react";
import { Switch, Route } from "react-router-dom";


import Login from "../features/users/Login";

function App() {
    return (
        <div>
            <Switch>
                <Route exact path="/login">
                    <Login />
                </Route>
            </Switch>
        </div>
    )
}

export default App;
